/**
 * React-PDF Quote Component
 * Beautiful, professional PDF quotes with custom styling
 */

import React from 'react';
import { Document, Page, Text, View, StyleSheet, Image } from '@react-pdf/renderer';

interface QuotePDFProps {
  quoteData: {
    id: string;
    customerName: string;
    customerEmail: string;
    customerPhone: string;
    moveDate: string;
    originAddress: string;
    destinationAddress: string;
    detections: any[];
    estimate: any;
    upsells: any[];
    totalAmount: number;
    photos?: any[];
  };
}

// Define styles
const styles = StyleSheet.create({
  page: {
    flexDirection: 'column',
    backgroundColor: '#ffffff',
    padding: 30,
    fontFamily: 'Helvetica',
  },
  header: {
    backgroundColor: '#2563eb',
    color: 'white',
    padding: 20,
    marginBottom: 20,
    textAlign: 'center',
  },
  headerTitle: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 5,
  },
  headerSubtitle: {
    fontSize: 12,
    opacity: 0.9,
  },
  section: {
    marginBottom: 20,
    padding: 15,
    backgroundColor: '#f8fafc',
    borderRadius: 8,
  },
  sectionTitle: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#1e40af',
    marginBottom: 10,
  },
  customerInfo: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    marginBottom: 15,
  },
  infoColumn: {
    flex: 1,
    marginRight: 10,
  },
  infoLabel: {
    fontSize: 10,
    color: '#6b7280',
    marginBottom: 2,
  },
  infoValue: {
    fontSize: 12,
    fontWeight: 'bold',
    color: '#374151',
  },
  moveDetails: {
    marginBottom: 15,
  },
  moveDetail: {
    flexDirection: 'row',
    marginBottom: 5,
  },
  moveLabel: {
    fontSize: 10,
    color: '#6b7280',
    width: 80,
  },
  moveValue: {
    fontSize: 12,
    color: '#374151',
    flex: 1,
  },
  inventorySection: {
    marginBottom: 20,
  },
  roomTitle: {
    fontSize: 14,
    fontWeight: 'bold',
    color: '#374151',
    marginBottom: 8,
    marginTop: 10,
  },
  itemRow: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    paddingVertical: 4,
    borderBottomWidth: 1,
    borderBottomColor: '#e5e7eb',
  },
  itemName: {
    fontSize: 11,
    color: '#374151',
    flex: 1,
  },
  itemQty: {
    fontSize: 11,
    color: '#6b7280',
    width: 40,
    textAlign: 'right',
  },
  pricingSection: {
    backgroundColor: '#f3f4f6',
    padding: 15,
    borderRadius: 8,
    marginTop: 20,
  },
  pricingRow: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    marginBottom: 5,
  },
  pricingLabel: {
    fontSize: 12,
    color: '#6b7280',
  },
  pricingValue: {
    fontSize: 12,
    fontWeight: 'bold',
    color: '#374151',
  },
  totalRow: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    borderTopWidth: 2,
    borderTopColor: '#d1d5db',
    paddingTop: 10,
    marginTop: 10,
  },
  totalLabel: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#374151',
  },
  totalValue: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#1e40af',
  },
  footer: {
    position: 'absolute',
    bottom: 30,
    left: 30,
    right: 30,
    textAlign: 'center',
    fontSize: 10,
    color: '#6b7280',
  },
});

export const QuotePDF: React.FC<QuotePDFProps> = ({ quoteData }) => {
  // Group detections by room
  const groupedItems = quoteData.detections.reduce((groups, item) => {
    const room = item.room || 'Other';
    if (!groups[room]) groups[room] = [];
    groups[room].push(item);
    return groups;
  }, {} as Record<string, any[]>);

  const selectedUpsells = quoteData.upsells.filter(u => u.selected);
  const upsellTotal = selectedUpsells.reduce((sum, u) => sum + u.price, 0);

  return (
    <Document>
      <Page size="A4" style={styles.page}>
        {/* Header */}
        <View style={styles.header}>
          <Text style={styles.headerTitle}>INSTANT QUOTE BUILDER</Text>
          <Text style={styles.headerSubtitle}>Professional Moving Services</Text>
        </View>

        {/* Customer Information */}
        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Customer Information</Text>
          <View style={styles.customerInfo}>
            <View style={styles.infoColumn}>
              <Text style={styles.infoLabel}>Name</Text>
              <Text style={styles.infoValue}>{quoteData.customerName}</Text>
            </View>
            <View style={styles.infoColumn}>
              <Text style={styles.infoLabel}>Email</Text>
              <Text style={styles.infoValue}>{quoteData.customerEmail}</Text>
            </View>
            <View style={styles.infoColumn}>
              <Text style={styles.infoLabel}>Phone</Text>
              <Text style={styles.infoValue}>{quoteData.customerPhone}</Text>
            </View>
            <View style={styles.infoColumn}>
              <Text style={styles.infoLabel}>Move Date</Text>
              <Text style={styles.infoValue}>{quoteData.moveDate}</Text>
            </View>
          </View>
        </View>

        {/* Move Details */}
        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Move Details</Text>
          <View style={styles.moveDetails}>
            <View style={styles.moveDetail}>
              <Text style={styles.moveLabel}>From:</Text>
              <Text style={styles.moveValue}>{quoteData.originAddress}</Text>
            </View>
            <View style={styles.moveDetail}>
              <Text style={styles.moveLabel}>To:</Text>
              <Text style={styles.moveValue}>{quoteData.destinationAddress}</Text>
            </View>
          </View>
        </View>

        {/* Inventory */}
        <View style={styles.inventorySection}>
          <Text style={styles.sectionTitle}>Inventory Summary</Text>
          {Object.entries(groupedItems).map(([room, items]) => (
            <View key={room}>
              <Text style={styles.roomTitle}>{room}</Text>
              {items.map((item, index) => (
                <View key={index} style={styles.itemRow}>
                  <Text style={styles.itemName}>
                    {item.label}
                    {item.size && ` (${item.size})`}
                  </Text>
                  <Text style={styles.itemQty}>Qty: {item.qty}</Text>
                </View>
              ))}
            </View>
          ))}
        </View>

        {/* Additional Services */}
        {selectedUpsells.length > 0 && (
          <View style={styles.section}>
            <Text style={styles.sectionTitle}>Additional Services</Text>
            {selectedUpsells.map((upsell) => (
              <View key={upsell.id} style={styles.itemRow}>
                <Text style={styles.itemName}>{upsell.name}</Text>
                <Text style={styles.itemQty}>${upsell.price.toFixed(2)}</Text>
              </View>
            ))}
          </View>
        )}

        {/* Pricing Summary */}
        <View style={styles.pricingSection}>
          <Text style={styles.sectionTitle}>Pricing Summary</Text>
          <View style={styles.pricingRow}>
            <Text style={styles.pricingLabel}>Base Moving Cost</Text>
            <Text style={styles.pricingValue}>${quoteData.estimate.total.toFixed(2)}</Text>
          </View>
          {upsellTotal > 0 && (
            <View style={styles.pricingRow}>
              <Text style={styles.pricingLabel}>Additional Services</Text>
